import React from "react";
import WeatherIcon from 'react-icons-weather';

export default function WeatherIcons(props){ 
    const codeMapping = {
        "01d": 800,
        "02d": 801,
        "03d": 802,
        "04d": 803,
        "09d": 300,
        "10d": 500,
        "13d": 511,
        "50d": 701
    }
    return(
        <div>
            <WeatherIcon name="owm" iconId={codeMapping[props.code]} flip="horizontal" rotate="90" />
        </div>
    );
}
